/* サイドの達人（ボトムの達人）*/

.side_banner_custom {
	z-index:20000;
	position: fixed;
	bottom:0;
	left:0;
	width:100%;
	background:#F0F0F0;
	padding:10px 0;
	filter: alpha(opacity=90);
	-moz-opacity:0.90;
	opacity:0.90;
}
.side_banner_custom .follow_leftArea{
	position:static!important;
	visibility: visible!important;
	margin:0 auto;
}
.side_banner_custom label{
	display:none;
	background:#FFF;
	border:3px solid #777;
	border-radius:100px;
	box-shadow:1px 1px 2px #777;
	color:#333;
	font-weight:bold;
	width:22px;
	padding:2px 0 0 2px;
	height:22px;
	line-height:22px;
	font-size:16px;
	text-align:center;
	cursor:pointer;
	position:absolute;
	right:15px;
	z-index:20001;
}

.side_banner_custom .contents,
.side_banner_custom input{
	display: none;
}
.side_banner_custom input:not(:checked) ~ .contents,
.side_banner_custom input:not(:checked) + label {
	display:block;
}
.side_banner_custom input:checked ~ .contents,
.side_banner_custom input:checked + label{
	display:none;
}


</style>

